def threeSum(nums):
        """
        :type nums: List[int]
        :rtype: List[List[int]]
        """
        if len(nums) < 3:
            return []
        
        mp = {}
        for i in nums:
            if i in mp:
                mp[i]+=1
            else:
                mp[i]=1
        
        out = []
        i = 0
        iVisited = {}
        jVisited = {}
        for i in range(len(nums)):
            item = nums[i]
            if item not in iVisited:
                mp[item]-=1
                for j in range(i+1,len(nums)):
                    if nums[j] not in jVisited:
                        mp[nums[j]]-=1
                        target = 0-(item+nums[j])
                        if target in mp and mp[target] != 0:
                            x = [item,nums[j],target]
                            x.sort()
                            if x not in out:
                                out.append(x)
                        mp[nums[j]]+=1
                        jVisited[nums[j]]=1
                mp[item]+=1
                iVisited[item] = 1
            print(iVisited)
            print(jVisited)
        
        return out

